import{_ as e,o as a,c as r,R as t}from"./chunks/framework.-otb-FOr.js";const _=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"Start/网站分享.md","filePath":"Start/网站分享.md","lastUpdated":1702657765000}'),p={name:"Start/网站分享.md"},o=t('<h2 id="设计篇" tabindex="-1">设计篇 <a class="header-anchor" href="#设计篇" aria-label="Permalink to &quot;设计篇&quot;">​</a></h2><p><a href="https://www.iconfont.cn/?spm=a313x.collections_detail.i3.d4d0a486a.171a3a81UV7tuV" target="_blank" rel="noreferrer">iconfont</a></p><p>阿里巴巴团队倾力打造的矢量图标库, 内容丰富, 支持不同下载格式, 如png, svg等. 登陆网站后还可对喜欢的图标进行收藏方便使用, 可认为是设计师/前端开发者必备的图标管理宝藏网站. 其中矢量图标的svg代码为博客网站的设计提供了很大的便利, 如本站的友情链接icon图标就是从该网站下载并直接使用的.</p><p><a href="https://www.bitbug.net/" target="_blank" rel="noreferrer">bitbug</a></p><p>比特虫: icon图标在线转换网站, 支持.jpg, gif, png等图像输入格式, 上传原始图像并输入验证码便可实现轻松转换.</p><p><a href="https://blog.csdn.net/F1004145107/article/details/106999446/" target="_blank" rel="noreferrer">Typora中的emoji标签</a></p><p>该博客中汇总了Typora中的emoji标签, 可用于博客写作中的内容设计.</p><p><a href="https://wallhere.com/" target="_blank" rel="noreferrer">wallhere</a></p><p>自称&quot;世界著名的壁纸网站之一&quot;, 所有图片可另存为下载, 然后将后缀中除.jpg, .png以外的部分删去即可查看, 若登录网站可选择不同规格的图片按网站官方渠道下载, 但貌似需要Facebook账号.</p><p><a href="https://pixabay.com/" target="_blank" rel="noreferrer">pixabay</a></p><p>另一个壁纸网站, 登录后可选择不同尺寸的图片下载.</p><h2 id="数学公式篇" tabindex="-1">数学公式篇 <a class="header-anchor" href="#数学公式篇" aria-label="Permalink to &quot;数学公式篇&quot;">​</a></h2><p><a href="http://detexify.kirelabs.org/classify.html" target="_blank" rel="noreferrer">Latex符号手写识别</a></p><p><a href="https://accounts.mathpix.com/signup?return_to=/account" target="_blank" rel="noreferrer">Mathpix</a></p><p>数学公式识别神器, 可根据截图, PDF文件或手写笔记提取公式并给出Latex格式, 准确率极高, 复制后可直接用于Latex写作, Word公式编辑器或Markdown文档编写中, 极大的提高了写作效率, 可认为是科研论文写作必备工具网站.</p><p><a href="https://www.latexlive.com/" target="_blank" rel="noreferrer">Latexlive</a></p><p>Latex公式编辑器, 可将编辑好的latex公式以多种形式输出, 如.png, .svg图片格式, html代码格式等, 该网站也支持公式图片识别, 并配有完善的latex公式模板, 便于原始公式编辑. 对于latex公式到word公式的格式转换比较友好.</p><hr><p><a href="https://zhuanlan.zhihu.com/p/490291830" target="_blank" rel="noreferrer">字体包</a></p><p>知乎专栏分享的 “常用字体:仿宋GB2312、楷体GB2312、方正小标宋简体的下载和安装方式”, 可解写作中的燃眉之急, 配享太庙.</p><h2 id="pdf文档工具" tabindex="-1">PDF文档工具 <a class="header-anchor" href="#pdf文档工具" aria-label="Permalink to &quot;PDF文档工具&quot;">​</a></h2><p><a href="https://smallpdf.com/" target="_blank" rel="noreferrer">Smallpdf</a></p><p>处理PDF文档的工具网站, 支持PDF文件的压缩, 编辑及各种常用格式的相互转换.</p><p>不足之处: 网站有一定的免费次数限制, 且用且珍惜.</p><h2 id="学习网站-博客分享" tabindex="-1">学习网站&amp;博客分享 <a class="header-anchor" href="#学习网站-博客分享" aria-label="Permalink to &quot;学习网站&amp;博客分享&quot;">​</a></h2><p><a href="https://zh.z-library.se/?afterGeoRedirection=1" target="_blank" rel="noreferrer">Zlibrary</a></p><p>全球最大免费电子书平台, 可以搜索和下载全世界最新, 最全的电子书, 非常Nice！ (PS: 需要魔法才能访问哦, 登录后即可畅快下载电子书, unbelievable~！)</p><p><a href="https://games-cn.org/page/2/" target="_blank" rel="noreferrer">计算机图形学与混合现实在线平台</a></p><p>也可去B站直接搜索GAMES-Webinar观看各位大佬的往期报告视频.</p><p><a href="https://www.cnblogs.com/tiandsp/p/14337176.html" target="_blank" rel="noreferrer">Dsp Tian</a></p><p>某位算法工程师的博客园网站, 包含了很多MATLAB练习代码, 可用于学习参考.</p><p><a href="https://www.cnblogs.com/yaoyansi/p/5196250.html" target="_blank" rel="noreferrer">多边形网格处理libig github</a></p><p><a href="https://mlnotebook.github.io/" target="_blank" rel="noreferrer">Machine Learning Notebook</a></p><p>机器学习基础知识分享博客(外国作者英文版)</p><hr><p><a href="https://highlightcode.com/" target="_blank" rel="noreferrer">HighlightCode在线工具</a></p><p>将代码自动转换成高亮样式, 可转换后添加到Word中用于排版</p><hr><p><a href="https://www.bingdoc.com/" target="_blank" rel="noreferrer">冰点文库</a></p><p>打败百度文库这个醜流氓的宝藏网站.</p><h2 id="ai工具篇" tabindex="-1">AI工具篇 <a class="header-anchor" href="#ai工具篇" aria-label="Permalink to &quot;AI工具篇&quot;">​</a></h2><p><a href="https://ai.updf.cn/file/787055158604341250" target="_blank" rel="noreferrer">UPDF AI</a></p><p>注册账号后可以上传英文文献, 网站将对文献进行解读，也可以向AI提问</p><p><a href="https://www.aippt.cn/editor?id=2847670&amp;source=workspace" target="_blank" rel="noreferrer">AiPPT </a></p><p>可以根据给定主题AI一键生成PPT的网站, 缺点是需要购买会员才能下载, 且有一定的次数限制, 但是可以参考AI生成的排版和内容快速制作PPT.</p><h2 id="文献阅读" tabindex="-1">文献阅读 <a class="header-anchor" href="#文献阅读" aria-label="Permalink to &quot;文献阅读&quot;">​</a></h2><p><a href="https://readpaper.com/home/" target="_blank" rel="noreferrer">ReadPaper</a></p><p>设计很全面, 功能很人性化的文献阅读网站, 可以网页直接使用也可以下载app, 内容登录账号后云端同步, 虽然会员需要花钱购买才能解锁AI阅读等功能, 但是如果只用普通的阅读器性价比也是很高的, 宝藏网站值得用</p><h2 id="整理中" tabindex="-1">整理中... <a class="header-anchor" href="#整理中" aria-label="Permalink to &quot;整理中...&quot;">​</a></h2>',49),n=[o];function l(h,i,s,c,f,d){return a(),r("div",null,n)}const g=e(p,[["render",l]]);export{_ as __pageData,g as default};
